INSERT INTO `articles` (`id`, `titre`, `contenue`, `created_at`, `updated_at`) VALUES
(1, 'INFORMATIONS GENERALES SUR LA REVUE', '<div class=\"center row\">\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://hnjm.mg/assets/images/head.png\" alt=\"\" data-cke-saved-src=\"https://hnjm.mg/assets/images/head.png\" /></p>\r\n</div>\r\n<p>R&eacute;dacteur en Chef : Pr RAZAFINDRABE JOHN Alberto Bam</p>\r\n<p>Secr&eacute;taire G&eacute;n&eacute;ral : Dr BEMORA Joseph Syn&egrave;se</p>\r\n<div><span style=\"background-color: #ffffff; color: #e03e2d; font-size: 10pt;\">C&rsquo;est une revue conjointe cr&eacute;e en 2019, compos&eacute;e de quatre soci&eacute;t&eacute;s savantes &agrave; Madagascar &agrave; savoir :</span></div>\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<h4>La Soci&eacute;t&eacute; Malgache de Neurochirurgie</h4>\r\n<img src=\"https://hnjm.mg/assets/images/neuro.png\" alt=\"\" data-cke-saved-src=\"https://hnjm.mg/assets/images/neuro.png\" />\r\n<p>Pr&eacute;sident: Pr ANDRIAMAMONJY Cl&eacute;ment</p>\r\n</div>\r\n<div class=\"col-lg-6\">\r\n<h4>La Soci&eacute;t&eacute; de Chirurgie Maxillo-Faciale de Madagascar</h4>\r\n<img src=\"https://hnjm.mg/assets/images/scmm.png\" alt=\"\" data-cke-saved-src=\"https://hnjm.mg/assets/images/scmm.png\" />\r\n<p>Pr&eacute;sident: Pr RAZAFINDRABE JOHN Alberto Bam</p>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<h4>La Soci&eacute;t&eacute; Malgache d&rsquo;Ophtalmologie</h4>\r\n<img src=\"https://hnjm.mg/assets/images/ophtalmo.png\" alt=\"\" data-cke-saved-src=\"https://hnjm.mg/assets/images/ophtalmo.png\" />\r\n<p>Pr&eacute;sident: Pr ANDRIANTSOA Rasoavelonoro Violette</p>\r\n</div>\r\n<div class=\"col-lg-6\">\r\n<h4>La Soci&eacute;t&eacute; Malgache d&rsquo;Otho-Rhino-Laryngologie</h4>\r\n<p><img src=\"https://hnjm.mg/assets/images/orl.png\" alt=\"\" data-cke-saved-src=\"https://hnjm.mg/assets/images/orl.png\" /></p>\r\n<p>Pr&eacute;sident: Pr RAKOTO Fanomezantsoa Andriamparany</p>\r\n</div>\r\n</div>\r\n<p>Le journal publie des articles issus de diff&eacute;rents auteurs (Nationaux et Internationaux), avec une parution de deux fois par an</p>\r\n<p>L&rsquo;HNJM accepte les manuscrits de recherche clinique ou fondamentale ayant trait au moins &agrave; l&rsquo;une de sp&eacute;cialit&eacute;s suivantes : Neurochirurgie, ORL, Ophtalmologie, Chirurgie Maxillo-Faciale et Stomatologie. Les articles originaux, les cas cliniques et les articles p&eacute;dagogiques sont accept&eacute;s pour r&eacute;vision et publication &eacute;ventuelle.</p>\r\n<p>Apr&egrave;s soumission de l&rsquo;article, l&rsquo;auteur aura une r&eacute;ponse (acceptation sans modification/ acceptation avec modification/ rejet) dans un d&eacute;lai de 03 mois environ.</p>', '2022-05-17 04:45:56', '2022-05-17 04:45:56'),
